  .kv{display:flex;justify-content:space-between;border-bottom:1px dashed #1f2b43;padding:4px 0;font-size:13px}

  const traits = tk.traits || [];
  const img = toGateway(tk.image || '');
  const is404 = !!(S.owners.owners404||{})[String(id)];
  const rank = (S.rank && S.rank[id]) || (S.sorted.indexOf(id)+1) || '—';

  const traitList = traits.slice().map(([t,v])=>({
    t,
    v,
    c: (S.traits.traitCounts||{})[`${t}::${v}`] || 1
  })).sort((a,b)=>a.c-b.c || a.t.localeCompare(b.t));

  const rows = traitList
    .map(x=>`<div class="kv"><span>${x.t}: <b>${x.v}</b></span><span>${fmt(x.c)} pcs</span></div>`)
    .join('');

  // NEW: if this id is in the current LP tail, show its Q#
  const qPos = (queuePos && queuePos[String(id)]) || null;
  const qBadge = qPos ? `<div class="qpos">Q#${qPos}</div>` : '';

  return `<div class="card">
    ${qBadge}
    <div class="rank">Rank ${rank}</div>${(S.teaser||{})[String(id)] ? `<div class="teaser"> ${(S.teaser||{})[String(id)]} </div>` : ""}
    <img class="img" loading="lazy" src="${img}" onclick="window.open('${img}', '_blank')" onerror="this.style.display='none'">
    <details class="traits"><summary>Trait details</summary>${rows}</details>
    <div class="meta"><span>#${id}</span><span class="badge">${is404 ? '404' : '721'}</span></div>
  </div>`;
}


function render(ids){
  const list = ids ? ids.slice() : S.sorted.slice();
  el('grid').innerHTML = list.map(cardHtml).join('');
  updateCount(list.length);
}

function search(){
  const mode = el('mode').value;
  const q = (el('query').value||'').trim();
  let out = [];
  if (mode==='wallet'){
    const w = q.toLowerCase();
    out = (S.idx.wallet||{})[w] || [];
  } else if (mode==='trait'){
    const m = q.match(/^([^:]+):\s*(.+)$/);
    if (m){
      const [_, t, v] = m;
      for (const id of S.ids){
        const tk=(S.traits.tokens||{})[String(id)]; if(!tk) continue;
        if ((tk.traits||[]).some(([tt,vv])=>tt.toLowerCase()===t.toLowerCase() && vv.toLowerCase()===v.toLowerCase())) out.push(id);
      }
    } else {
      const terms = q.toLowerCase().split(/[,\s]+/).filter(Boolean);
      for (const id of S.ids){
        const tk=(S.traits.tokens||{})[String(id)]; if(!tk) continue;
        const hay = (tk.traits||[]).map(([tt,vv])=>tt+':'+vv).join(' ').toLowerCase();
        if (terms.every(term=>hay.includes(term))) out.push(id);
      }
    }
  } else if (mode==='token'){
    const id = parseInt(q,10); if (!isNaN(id)) out=[id];
  }
  
  // Always sort search results by rarity (ascending rank)
  if (out && out.length){
    const r = (x)=> (S.rank && S.rank[x]) || (S.sorted.indexOf(x)+1) || 9999999;
    out.sort((a,b)=>r(a)-r(b));
  }
  S.filterIds = out.length? out : null;
  render(S.filterIds || S.sorted);
}
function clearSearch(){ el('query').value=''; S.filterIds=null; render(); updateCount(S.sorted.length); }

async function rpcCall(method, params, timeout=20000){
  const url = el('rpc').value.trim();
  const ctl = new AbortController(); const to = setTimeout(()=>ctl.abort(), timeout);
  const res = await fetch(url,{method:'POST',headers:{'content-type':'application/json'},body: JSON.stringify({jsonrpc:'2.0', id:1, method, params}), signal: ctl.signal});
  clearTimeout(to); const j=await res.json(); if(j.error) throw new Error(j.error.message||'RPC error'); return j.result;
}
async function ethCall(to, data){ return rpcCall('eth_call', [{to,data}, 'latest']); }

async function updateOwnersDelta(){
  if (S.scanning) return;
  S.scanning = true; setStatus('Updating owners (delta)…');
  const ADDR_721=el('addr721').value.trim(); const ADDR_404=el('addr404').value.trim();
  const ids = (S.filterIds && S.filterIds.length? S.filterIds : S.ids).slice();
  const owners721={...(S.owners.owners721||{})}; const owners404={...(S.owners.owners404||{})}; const ownersTrue={...(S.owners.ownersTrue||{})};
  const workers = Math.min(16, (navigator.hardwareConcurrency||8));
  const Q = ids.slice(); let done=0; const tasks=[];
  for (let i=0;i<workers;i++) tasks.push((async()=>{
    while(Q.length){
      const id = Q.pop();
      try{
        const sel='0x6352211e'+encUint(id).slice(2).padStart(64,'0');
        const r1 = await ethCall(ADDR_721, sel);
        if(!r1||r1==='0x'||r1.length<66) continue;
        const a=('0x'+r1.slice(-40)).toLowerCase();
        owners721[String(id)] = a;
        if(a===ADDR_404.toLowerCase()){
          const r2=await ethCall(ADDR_404, sel);
          if(r2&&r2.length>=66){
            const b=('0x'+r2.slice(-40)).toLowerCase();
            owners404[String(id)] = b; ownersTrue[String(id)] = b;
          }
        } else { owners404[String(id)] = undefined; ownersTrue[String(id)] = a; }
      }catch(e){}
      done++; if (done%100===0) setStatus(`Owners delta: ${done} / ${ids.length}`);
    }
  })());
  await Promise.all(tasks);
  S.owners.owners721=owners721; S.owners.owners404=owners404; S.owners.ownersTrue=ownersTrue;
  buildOwnerIndex(); setDiag(); setStatus('Owners updated.'); S.scanning=false; render(S.filterIds || S.sorted);
}

function saveSnapshot(){
  el('embeddedOwners').textContent = JSON.stringify(S.owners);
  el('embeddedTraits').textContent = JSON.stringify(S.traits);
  el('embeddedIndex').textContent  = JSON.stringify(S.idx);
  const html='<!DOCTYPE html>'+document.documentElement.outerHTML;
  const a=document.createElement('a'); a.href=URL.createObjectURL(new Blob([html],{type:'text/html'}));
  const current=(location.pathname.split('/').pop()||'SWOL_Trait_Rarity.html'); a.download=current;
  a.click(); URL.revokeObjectURL(a.href);
}

// Bind
document.getElementById('btnSearch').onclick = search;
document.getElementById('btnClear').onclick = clearSearch;
document.getElementById('btnUpdateOwners').onclick = ()=>updateOwnersDelta().catch(e=>setStatus('Owners failed: '+(e.message||e)));
document.getElementById('btnFullMeta').onclick = ()=>alert('Full metadata refresh will be added here (kept minimal for this cut).');
document.getElementById('btnSave').onclick = saveSnapshot;

// Initial render
(function init(){
  const have = Object.keys(S.traits.tokens||{}).length;
  if (have) render(); else document.getElementById('grid').innerHTML='<div class="muted">No embedded metadata yet — use Full refresh later, then Save snapshot.</div>';
  updateCount(have? S.sorted.length : 0);
  try{ setTimeout(()=>{ updateOwnersDelta().catch(()=>{}); }, 800); }catch(e){}
})();

// === Next in Line (ERC-404 queue) ===
(function(){
  const el = (id)=>document.getElementById(id);
  let queueIds = [];
  let queueTimer = null;
  const SIG_list = '0x86ca1618';

  function rdUint(hex, off){ const h = hex.slice(2); return BigInt('0x'+h.slice(off*2, off*2+64)); }
  function decUintArr(hex){
    if(!hex || hex==='0x') return [];
    const h = hex.slice(2);
    const rd = (o)=>BigInt('0x'+h.slice(o*2, o*2+64));
    const off = Number(rd(0));
    const len = Number(rd(off));
    const arr = [];
    for (let i=0;i<len;i++){ arr.push(rd(off+32+i*32).toString()); }
    return arr;
  }
  function setStatusQ(msg){ el('statusQ').textContent = msg||''; }

  function computeTail(ids){
    const N = Math.max(1, Math.min(2000, parseInt(el('countQ').value||'20',10)));
    const tail = ids.slice(-N).reverse();
    return tail;
  }

  function teaserFor(id){
    const teaser = (S.teaser||{})[String(id)];
    return teaser ? `<div class="teaser">${teaser}</div>` : '';
  }

  function mkCardQ(id, qIndex){
    const tk = (S.traits.tokens||{})[String(id)] || {};
    const img = toGateway(tk.image||'');
    const is404 = !!(S.owners.owners404||{})[String(id)];
    const teaser = teaserFor(id);
    return `<div class="card" data-id="${id}">
      <!-- Q-position label is absolutely positioned *inside* the card so it moves
           with the tile in all grid/filter situations. -->
      <div class="qpos">Q#${qIndex}</div>
      ${qIndex===1?'<div class="next">NEXT</div>':''}
      ${teaser}
      <img class="img" loading="lazy" src="${img}" onclick="window.open('${img}','_blank')" onerror="this.style.display='none'">
      <details class="traits"><summary>Trait details</summary>${
        (tk.traits||[]).map(([t,v])=>{
           const c=(S.traits.traitCounts||{})[`${t}::${v}`]||1;
           return `<div class="kv"><span>${t}: <b>${v}</b></span><span>${c} pcs</span></div>`;
        }).join('')
      }</details>
      <div class="meta"><span>#${id}</span><span class="badge">${is404?'404':'721'}</span></div>
    </div>`;
  }

  function filterMatchTraits(id, q){
    if(!q) return true;
    const tk=(S.traits.tokens||{})[String(id)]||{};
    const hay = (tk.traits||[]).map(([t,v])=>`${t}:${v}`).join(' ').toLowerCase();
    return hay.includes(q);
  }

  function renderQueue(ids){
  const q = (el('traitQ').value || '').trim().toLowerCase();

  // Full tail (unfiltered)
  const fullTail = computeTail(ids);

  // Map: token ID -> original queue position in the tail
  const posMap = new Map();
  fullTail.forEach((id, idx) => {
    posMap.set(String(id), idx + 1);  // Q# is 1-based
  });

  // Apply trait filter but keep original queue positions
  const tail = fullTail.filter(id => filterMatchTraits(id, q));

  setStatusQ(`Showing ${tail.length} (next first)`);

  const htmlCards = tail
    .map(id => {
      const qPos = posMap.get(String(id)) || 0; // fallback just in case
      return mkCardQ(id, qPos);
    })
    .join('');

  el('gridQ').innerHTML = htmlCards;
}


async function fetchQueue(){
  try{
    setStatusQ('Loading queue…');
    const hex = await ethCall(el('addr404').value.trim(), SIG_list);
    queueIds = decUintArr(hex);

    // Build global map: token ID -> queue position in the current tail
    const fullTail = computeTail(queueIds); // same tail you show in Next in Line
    queuePos = {};
    fullTail.forEach((id, idx) => {
      queuePos[String(id)] = idx + 1; // 1 = NEXT
    });

    renderQueue(queueIds);
    setStatusQ('');
  }catch(e){
    setStatusQ('Error: '+(e.message||e));
  }
}


  function startAuto(){
    stopAuto();
    if (el('autoQ').value==='off') return;
    const N = Math.max(1, Math.min(2000, parseInt(el('countQ').value||'20',10)));
    const interval = (N<=20) ? 2000 : 15000;
    queueTimer = setInterval(fetchQueue, interval);
  }
  function stopAuto(){ if(queueTimer){ clearInterval(queueTimer); queueTimer=null; } }

  // Tab switching
function show(which){
  const tabR = el('tabR'), tabQ = el('tabQ');
  const panelQ = el('panelQ');

  // First Trait & Rarity header bar (RPC + filters)
  const controlsBar = document.querySelector('.bar');

  // Bar that holds the Trait & Rarity grid
  const traitsGridBar = document.querySelector('#grid').parentElement;

  if (which === 'q') {
    // Show "Next in Line"
    tabQ.classList.add('active');
    tabR.classList.remove('active');

    panelQ.classList.remove('hidden');      // show queue panel
    controlsBar.classList.add('hidden');    // hide Trait&Rarity header
    traitsGridBar.classList.add('hidden');  // hide Trait&Rarity grid

    fetchQueue().then(startAuto);
    el('liveDiag').textContent = 'Queue live';
  } else {
    // Show "Trait & Rarity"
    tabR.classList.add('active');
    tabQ.classList.remove('active');

    panelQ.classList.add('hidden');         // hide queue panel
    controlsBar.classList.remove('hidden'); // show Trait&Rarity header
    traitsGridBar.classList.remove('hidden'); // show Trait&Rarity grid

    stopAuto();
    el('liveDiag').textContent = '';
    render(S.filterIds || S.sorted);
  }
}

  // Bind
  el('tabQ').onclick = ()=>show('q');
  el('tabR').onclick = ()=>show('r');
  el('btnApplyQ').onclick = ()=>{ renderQueue(queueIds); };
  el('btnRefreshQ').onclick = ()=>{ fetchQueue(); };
  el('autoQ').onchange = ()=>startAuto();
  el('countQ').onchange = ()=>startAuto();

  // Debounced live filter for the queue trait search so the Q# label always
  // matches the visual order even before pressing "Apply".
  let _qFilterTimer = null;
  el('traitQ').addEventListener('input', ()=>{
    if(_qFilterTimer) cancelAnimationFrame(_qFilterTimer);
    _qFilterTimer = requestAnimationFrame(()=>{
      renderQueue(queueIds);
    });
  });


  // Expose show for initial state (keep default 'r')
  window._swolShow = show;
  show('q');
})();</script>
</body>
